import styled from "styled-components";

const AccountStyle = {
    ContainerAccount: styled.div`
    padding-left: 120px;
    `,
    SideBar: styled.nav`
    width: 100px;
    display: flex;
    position: absolute;
    flex-direction: column;
    align-items: center;
    left: 0;
    top: 0;
    background-color: blue;
    padding: 20px;
    height: 100vh;
    `,
    ContainerImg: styled.div`
    max-width: 281px;
    max-height: 500px;
    `,
    About
}

export default AccountStyle
